import React from 'react'
import { Container, Section, Span } from '../comunidade/StyledComunidade';
import styled from 'styled-components';

const StyledQuestionario = styled.div`
        h2 {
            color: red;
            display: block;
        }
        input {
            color: green;
        }
`;

const StyledPergunta = styled.input`
        color: green;
`;


function Questionario() {
    return (
        <>   <>
            <Span>
                <h1>Termos de Uso Panace.IA</h1>
                <h3>Leia com atenção</h3>
            </Span>
            <Container>

                <Section>

                    <StyledQuestionario>
                        <StyledPergunta type="radio">Eu gosto de macarrão</StyledPergunta>
                    </StyledQuestionario>

                    <StyledQuestionario>
                        <h2>Pergunta 1</h2>
                        <input type="radio" name="question1" />a maior parte do tempo
                        <input type="radio" name="question1" />boa parte do tempo
                        <input type="radio" name="question1" />de vez em quando
                        <input type="radio" name="question1" />nunca
                    </StyledQuestionario>
                    <div>
                        <h2>Pergunta 2</h2>
                        <p></p>

                    </div>
                    <div>
                        <h2>Pergunta 3</h2>
                    </div>
                    <div>
                        <h2>Pergunta 4</h2>
                    </div>
                    <div>
                        <h2>Pergunta 5</h2>
                    </div>
                    <div>
                        <h2>Pergunta 6</h2>
                    </div>

                </Section>


            </Container>
        </>
        </>
    );
}

export default Questionario;
